    )
    return (
        <div>
            <h1>All Admin Details</h1>
            {admins.length > 0
                ? admins.map((item)=><Admin key={item.adminId} admin={item} />)
            : "No Admins"}
            
        </div>
    )
}

export default AllAdmin;
